import{_ as a,c as r,o as t,ag as o}from"./chunks/framework.V1ghUkRo.js";const b=JSON.parse('{"title":"前端","description":"","frontmatter":{},"headers":[],"relativePath":"frontend/index.md","filePath":"frontend/index.md"}'),s={name:"frontend/index.md"};function h(l,e,i,p,n,c){return t(),r("div",null,[...e[0]||(e[0]=[o('<h1 id="前端" tabindex="-1">前端 <a class="header-anchor" href="#前端" aria-label="Permalink to &quot;前端&quot;">​</a></h1><h2 id="如何学习" tabindex="-1">如何学习？ <a class="header-anchor" href="#如何学习" aria-label="Permalink to &quot;如何学习？&quot;">​</a></h2><p>前端，说人话就是“给用户看的东西”，一般情况下指的是 Web 前端，即网站的制作。它是一个系统性相对较强，且网上视频资源较多的东西，我们优先推荐各位同学以在线视频教学自学为主。</p><p>不过跟中学时期你看的视频网课不同的是，计算机是一个及其强调实践的学科，光是认真听讲是难以长期记忆前端繁多的属性、函数等东西的。我们需要跟着视频课程进行<strong>实时、同步的练习</strong>（说人话就是边看边敲），才能够形成较为长期的记忆。</p><p>我们目前较为建议的学习路线为：HTML &amp; CSS → JavaScript 基础与高级语法 → NodeJS 基本使用 → Vue 3 框架 → <a href="./../startup/">预备课</a> → TypeScript → React 框架</p><h2 id="焚-诀" tabindex="-1">焚！诀！ <a class="header-anchor" href="#焚-诀" aria-label="Permalink to &quot;焚！诀！&quot;">​</a></h2><p>哪里不清楚的！查！查<a href="#参考文档">文档</a>！</p><p>查不到别怕，多问组员和组长，over！</p><h2 id="学习清单" tabindex="-1">学习清单 <a class="header-anchor" href="#学习清单" aria-label="Permalink to &quot;学习清单&quot;">​</a></h2><p>以下是我们挑选的较为适合新手同学且内容较新的视频网课链接，注意查收~</p><h3 id="html-css" tabindex="-1">HTML &amp; CSS <a class="header-anchor" href="#html-css" aria-label="Permalink to &quot;HTML &amp; CSS&quot;">​</a></h3><p><a href="https://www.bilibili.com/video/BV1kM4y127Li" target="_blank" rel="noreferrer">前端Web开发HTML5+CSS3+移动web视频教程，前端web入门首选黑马程序员</a></p><h3 id="javascript" tabindex="-1">JavaScript <a class="header-anchor" href="#javascript" aria-label="Permalink to &quot;JavaScript&quot;">​</a></h3><p><a href="https://www.bilibili.com/video/BV1Y84y1L7Nn" target="_blank" rel="noreferrer">黑马程序员前端JavaScript入门到精通全套视频教程，javascript核心进阶ES6语法、API、js高级等基础知识和实战教程</a></p><h3 id="开始使用框架前的准备" tabindex="-1">开始使用框架前的准备 <a class="header-anchor" href="#开始使用框架前的准备" aria-label="Permalink to &quot;开始使用框架前的准备&quot;">​</a></h3><p><a href="https://www.bilibili.com/video/BV1MN411y7pw" target="_blank" rel="noreferrer">黑马程序员前端AJAX入门到实战全套教程，包含学前端框架必会的（ajax+node.js+webpack+git）</a></p><p><em>注：Webpack 相关内容可以跳过，因为现在的打包工具主要用 Vite，且框架里边的配置足够我们的学习阶段了，关于后续优化之类的可以自己问AI或者啃文档。但如果是需要准备就业的同学，还是有必要在后面回头来看看的。</em> 😗</p><h3 id="vue-js" tabindex="-1">Vue.js <a class="header-anchor" href="#vue-js" aria-label="Permalink to &quot;Vue.js&quot;">​</a></h3><p><a href="https://www.bilibili.com/video/BV1Za4y1r7KE" target="_blank" rel="noreferrer">尚硅谷Vue3入门到实战，最新版vue3+TypeScript前端开发教程</a></p><h3 id="typescript" tabindex="-1">TypeScript <a class="header-anchor" href="#typescript" aria-label="Permalink to &quot;TypeScript&quot;">​</a></h3><p><a href="https://www.bilibili.com/video/BV1YS411w7Bf" target="_blank" rel="noreferrer">禹神：三小时快速上手TypeScript，TS速通教程</a></p><h3 id="react" tabindex="-1">React <a class="header-anchor" href="#react" aria-label="Permalink to &quot;React&quot;">​</a></h3><p><a href="https://www.bilibili.com/video/BV1ZB4y1Z7o8" target="_blank" rel="noreferrer">黑马程序员前端React18入门到实战视频教程，从react+hooks核心基础到企业级项目开发实战（B站评论、极客园项目等）及大厂面试全通关</a></p><h2 id="参考文档" tabindex="-1">参考文档 <a class="header-anchor" href="#参考文档" aria-label="Permalink to &quot;参考文档&quot;">​</a></h2><p>为方便查询，同学们可以将需要的文档添加到浏览器书签。</p><p><em>注：我们为部分无官方中文的文档提供了非官方的中文翻译入口，其中可能带有部分无关或有害信息，请同学们谨慎辨别</em></p><h3 id="html-css-js" tabindex="-1">HTML &amp; CSS &amp; JS <a class="header-anchor" href="#html-css-js" aria-label="Permalink to &quot;HTML &amp; CSS &amp; JS&quot;">​</a></h3><p>MDN：<a href="https://developer.mozilla.org/zh-CN/" target="_blank" rel="noreferrer">https://developer.mozilla.org/zh-CN/</a></p><h3 id="vue-js-1" tabindex="-1">Vue.js <a class="header-anchor" href="#vue-js-1" aria-label="Permalink to &quot;Vue.js&quot;">​</a></h3><p>框架文档：<a href="https://cn.vuejs.org" target="_blank" rel="noreferrer">https://cn.vuejs.org</a></p><p>Router 文档：<a href="https://router.vuejs.org/zh/" target="_blank" rel="noreferrer">https://router.vuejs.org/zh/</a></p><p>Pinia 文档：<a href="https://pinia.vuejs.org/zh/" target="_blank" rel="noreferrer">https://pinia.vuejs.org/zh/</a></p><h3 id="typescript-1" tabindex="-1">TypeScript <a class="header-anchor" href="#typescript-1" aria-label="Permalink to &quot;TypeScript&quot;">​</a></h3><p>官方文档：<a href="https://www.typescriptlang.org/zh/docs/" target="_blank" rel="noreferrer">https://www.typescriptlang.org/zh/docs/</a></p><p>由于官方文档本地化和阅读体验极差，此处可以考虑去看阮一峰的<a href="https://wangdoc.com/typescript/" target="_blank" rel="noreferrer">《TypeScript 教程》</a>。</p><h3 id="react-1" tabindex="-1">React <a class="header-anchor" href="#react-1" aria-label="Permalink to &quot;React&quot;">​</a></h3><p>官方文档：<a href="https://zh-hans.react.dev" target="_blank" rel="noreferrer">https://zh-hans.react.dev</a></p><h3 id="next-js" tabindex="-1">Next.js <a class="header-anchor" href="#next-js" aria-label="Permalink to &quot;Next.js&quot;">​</a></h3><p>官方文档：<a href="https://nextjs.org/docs" target="_blank" rel="noreferrer">https://nextjs.org/docs</a></p><p><strong>非官方</strong>中文翻译：<a href="https://nextjscn.org/docs" target="_blank" rel="noreferrer">https://nextjscn.org/docs</a></p><h3 id="nuxt-js" tabindex="-1">Nuxt.js <a class="header-anchor" href="#nuxt-js" aria-label="Permalink to &quot;Nuxt.js&quot;">​</a></h3><p>官方文档：<a href="https://nuxt.com/" target="_blank" rel="noreferrer">https://nuxt.com/</a></p><p><strong>非官方</strong>中文翻译：<a href="https://nuxtjs.org.cn/" target="_blank" rel="noreferrer">https://nuxtjs.org.cn/</a></p><h2 id="题外话" tabindex="-1">题外话 <a class="header-anchor" href="#题外话" aria-label="Permalink to &quot;题外话&quot;">​</a></h2><p>固然 React 和 Vue 作为行业主流的前端框架，是具有经过时代检验的优秀性能和开发体验的，但其虚拟 DOM 的特性对于静态或数据交互量不大的项目而言，也会造成一定的不必要性能开销。虽然我们可以像 <a href="https://vitepress.dev/zh/" target="_blank" rel="noreferrer">VitePress</a> 等项目，在构建过程中就使用预渲染技术，但有些走在行业前沿的新兴前端框架也是值得一看的。</p><p>由于以下框架较新，很难找到适合大众的视频课教程，需要各位自己去寻找啦~</p><h3 id="solid" tabindex="-1">Solid <a class="header-anchor" href="#solid" aria-label="Permalink to &quot;Solid&quot;">​</a></h3><p>Solid 拥有类似 React 的语法，且状态变化时只更新绑定该状态的 DOM 节点，无 diff 过程，性能很高，建议熟悉 React 的同学一定要来看看。</p><p>官方文档：<a href="https://docs.solidjs.com/" target="_blank" rel="noreferrer">https://docs.solidjs.com/</a></p><p><strong>非官方</strong>中文翻译：<a href="https://solid.yayujs.com/" target="_blank" rel="noreferrer">https://solid.yayujs.com/</a></p><h3 id="svelte" tabindex="-1">Svelte <a class="header-anchor" href="#svelte" aria-label="Permalink to &quot;Svelte&quot;">​</a></h3><p>Svelte 在构建时就生成直接操作 DOM 的 JavaScript 代码，因此其构建后代码不包含运行时，打包成品体积很小。</p><p>官方文档：<a href="https://svelte.dev/docs/svelte" target="_blank" rel="noreferrer">https://svelte.dev/docs/svelte</a></p><p><strong>非官方</strong>中文翻译：<a href="https://svelte.js.cn/docs/svelte" target="_blank" rel="noreferrer">https://svelte.js.cn/docs/svelte</a></p><h3 id="astro" tabindex="-1">Astro <a class="header-anchor" href="#astro" aria-label="Permalink to &quot;Astro&quot;">​</a></h3><p>Astro 是一个静态站点生成器，专注于构建博客、文档之类的以内容为核心的站点，核心理念是少用 JavaScript，按需加载。默认输出纯静态 HTML + CSS，首屏加载极快。自动代码分割、按需加载、图片优化、字体优化等开箱即用。</p><p>另外，这个框架是无关 UI 的，且可以与 React、Vue、Svelte、Solid 等集成。</p><p>官方文档：<a href="https://docs.astro.build/zh-cn" target="_blank" rel="noreferrer">https://docs.astro.build/zh-cn</a></p>',58)])])}const f=a(s,[["render",h]]);export{b as __pageData,f as default};
